(952, 'Encyclopédie des gens du monde', 22, 'Wolf', 'Christian, Baron de', 744, NULL, 2, NULL, NULL, 'Biographie', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'Leibnitz', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Oui', 'Oui', 'Non', 'Non', 'Signé C.L. (\"Les lettres C. L. indiquent qu’un article est traduit du Convertations-Lexicon,ou de «on supplément intitulé Conversations-Lexiconder Gegenwart\")\r\n\r\nL’article parle plutôt plus en détail de ses travaux de philosophie, mais insiste beaucoup sur le fait qu’il fut mathématicien et son apport dans cette science.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'duransamson@gmail.com', 'duransamson@gmail.com'),
(953, 'Encyclopédie des gens du monde', 22, 'Young', 'Thomas', 782, 783, 1, NULL, NULL, 'Biographie', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Hiéroglyphes', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Oui', 'Oui', 'Non', 'Non', 'Signé C.L. (\"Les lettres C. L. indiquent qu’un article est traduit du Convertations-Lexicon,ou de «on supplément intitulé Conversations-Lexiconder Gegenwart\")\r\n\r\nYoung est décrit comme \"mathématicien\" mais l’article ne donne pas de détail et se contente d’indiquer \"il accepta une chaire de professeur des sciences naturelles à l’Institut royal, et publia de nombreux ouvrages sur la phy-sique et lés mathématiques\". Deux livres de mathématiques sont tout de même donnés.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'duransamson@gmail.com', NULL),
